import React from 'react';
import {Col} from 'react-bootstrap'

const CarItem = ({car}) => {
    return (
        <Col>
            <p>{car.name}</p>
            <p>{car.price} руб.</p>
            <p>{car.year}</p>
            <p>{car.engine}</p>
            <p>{car.drive}</p>
            <p>{car.mileage}</p>
        </Col>
    );
};

export default CarItem;
